@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .
@prefix atm: <http://www.example.com/ATM#> .

atm:ATM rdf:type owl:Class .

atm:Transaction rdf:type owl:Class .

atm:Receipt rdf:type owl:Class .

atm:prints rdf:type owl:ObjectProperty ;
           rdf:domain atm:ATM ;
           rdf:range atm:Receipt .

atm:completes rdf:type owl:ObjectProperty ;
              rdf:domain atm:ATM ;
              rdf:range atm:Transaction .

atm:Transaction owl:equivalentClass [
    rdf:type owl:Restriction ;
    owl:onProperty atm:completes ;
    owl:someValuesFrom [
        rdf:type owl:Restriction ;
        owl:onProperty atm:prints ;
        owl:someValuesFrom atm:Receipt
    ]
] .
